import React, { useState } from "react";
import DataEmails from "../Data/Emails";
import "./Mails.css";

function ImportantEmail() {
  const [Data, setdata] = useState(DataEmails);

  return (
    <div className="row">
      {Data.map((v) => (
        <div className="col">
          <div className="card">
            <img src="https://picsum.photos/200/300" alt="product" />
            <div className="card-header">{v.description}</div>
            <div className="card-body">{v.email}</div>
          </div>
        </div>
      ))}
    </div>
  );
}

export default ImportantEmail;
